import React, { useEffect, useState, useCallback, useMemo } from "react";
import {
  GoogleMap,
  useLoadScript,
  MarkerF,
  InfoWindowF,
} from "@react-google-maps/api";
import { useParams, Link } from "react-router-dom";
import CoordenadasService from "../services/CoordenadasService";

const mapContainerStyle = {
  height: "400px",
  width: "100%",
};

const defaultCenter = { lat: 4.570868, lng: -74.297333 }; // Default center of Colombia

const libraries = ["places"];

function MapaIndividual() {
  const { idpersona } = useParams();
  const [marker, setMarker] = useState(null);
  const [isInfoWindowOpen, setIsInfoWindowOpen] = useState(false);
  const [error, setError] = useState(null);
  const [isLoading, setIsLoading] = useState(true);

  const { isLoaded, loadError } = useLoadScript({
    googleMapsApiKey: "AIzaSyBomnY9UemevV5IVEXtYHP6SWw3kRsERGc",
    libraries,
  });

  const fetchCoordenadas = useCallback(async () => {
    try {
      setIsLoading(true);
      const coordenadas = await CoordenadasService.getCoordenadasIndividual(
        idpersona
      );

      if (!coordenadas || !coordenadas.latitud || !coordenadas.longitud) {
        throw new Error("Se recibieron datos inválidos o incompletos");
      }

      // Swap latitude and longitude
      const lat = parseFloat(coordenadas.longitud);
      const lng = parseFloat(coordenadas.latitud);

      if (
        isNaN(lat) ||
        isNaN(lng) ||
        lat < -90 ||
        lat > 90 ||
        lng < -180 ||
        lng > 180
      ) {
        throw new Error("Coordenadas fuera de rango válido");
      }

      setMarker({
        id: coordenadas.id,
        marca: coordenadas.marca,
        lat,
        lng,
      });
      setError(null);
    } catch (error) {
      console.error("Error al obtener coordenadas:", error);
      setError(error.message || "Error al obtener las coordenadas");
    } finally {
      setIsLoading(false);
    }
  }, [idpersona]);

  useEffect(() => {
    fetchCoordenadas();
  }, [fetchCoordenadas]);

  const handleMarkerClick = useCallback(() => {
    setIsInfoWindowOpen(true);
  }, []);

  const handleInfoWindowClose = useCallback(() => {
    setIsInfoWindowOpen(false);
  }, []);

  const mapOptions = useMemo(
    () => ({
      disableDefaultUI: true,
      clickableIcons: false,
      scrollwheel: true,
    }),
    []
  );

  const renderMap = useMemo(() => {
    if (!isLoaded) return null;

    return (
      <GoogleMap
        mapContainerStyle={mapContainerStyle}
        center={marker ? { lat: marker.lat, lng: marker.lng } : defaultCenter}
        zoom={marker ? 12 : 5}
        options={mapOptions}
      >
        {marker && (
          <MarkerF
            position={{ lat: marker.lat, lng: marker.lng }}
            onClick={handleMarkerClick}
          >
            {isInfoWindowOpen && (
              <InfoWindowF
                position={{ lat: marker.lat, lng: marker.lng }}
                onCloseClick={handleInfoWindowClose}
              >
                <div>
                  <h3 className="font-bold">{marker.marca}</h3>
                  <p>ID: {marker.id}</p>
                  <p>Latitud: {marker.lat.toFixed(6)}</p>
                  <p>Longitud: {marker.lng.toFixed(6)}</p>
                </div>
              </InfoWindowF>
            )}
          </MarkerF>
        )}
      </GoogleMap>
    );
  }, [
    isLoaded,
    marker,
    isInfoWindowOpen,
    handleMarkerClick,
    handleInfoWindowClose,
    mapOptions,
  ]);

  if (loadError) {
    return <div>Error al cargar el mapa</div>;
  }

  return (
    <div className="flex flex-col items-center justify-center min-h-screen bg-gradient-to-b from-blue-500 to-blue-700 p-4">
      <div className="w-full max-w-3xl bg-white rounded-lg shadow-lg p-6">
        <h1 className="text-2xl font-bold mb-4 text-gray-800 text-center">
          Mapa Individual
        </h1>

        {error && (
          <div
            className="bg-red-100 border border-red-400 text-red-700 px-4 py-3 rounded relative mb-4"
            role="alert"
          >
            <strong className="font-bold">Error!</strong>
            <span className="block sm:inline"> {error}</span>
          </div>
        )}

        {isLoading ? (
          <div className="flex justify-center items-center h-[400px]">
            <div className="animate-spin rounded-full h-32 w-32 border-t-2 border-b-2 border-blue-500"></div>
          </div>
        ) : (
          <div className="flex justify-center">{renderMap}</div>
        )}
      </div>
      <div className="mt-4 flex justify-center">
        <Link
          to="/home"
          className="bg-green-500 hover:bg-green-600 text-white font-bold py-2 px-4 rounded"
        >
          Volver al Inicio
        </Link>
      </div>
    </div>
  );
}

export default MapaIndividual;
